// Process reconciliation data from Orchestrator Agent and prepare ledger entries
const reconciliationData = $input.first().json;

// Extract corrections from the reconciliation data
const corrections = reconciliationData.mismatches || [];

// Prepare ledger entries for each correction
const ledgerEntries = corrections.map(mismatch => {
  return {
    mismatchId: mismatch.mismatchId,
    transactionId: mismatch.transactionId || mismatch.mismatchId,
    rootCause: mismatch.rootCause,
    confidence: mismatch.confidence,
    correction: mismatch.correction,
    discrepancyAmount: mismatch.discrepancyAmount,
    processedAt: new Date().toISOString(),
    status: 'applied'
  };
});

// Calculate summary statistics
const summary = {
  totalMismatches: corrections.length,
  totalCorrections: corrections.length,
  reconciliationDate: new Date().toISOString(),
  totalDiscrepancyAmount: corrections.reduce((sum, m) => sum + (m.discrepancyAmount || 0), 0)
};

// Return structured output
return [
  {
    json: {
      reconciliationSummary: summary,
      ledgerEntries: ledgerEntries,
      originalData: reconciliationData
    }
  }
];

